import React, { useState } from "react"                     
import "../index.css"
import sathaye from '../icons/sathaye.png'
import { Navigate } from "react-router-dom"
import like from '../icons/like.png'
import liked from '../icons/liked.png'
import Modal from 'react-modal';
import { FaRegHeart, FaHeart, FaLocationArrow  } from "react-icons/fa";
import { CiLocationArrow1 } from "react-icons/ci";
import { TiArrowForwardOutline } from "react-icons/ti";
import RegistrationPopup from './Events';



const Post = ({data}) => {

    const [registration, setRegistration] = useState({
      eventName: '',
      name: '',
      className: '',
    });
  
    // const [showPopup, setShowPopup] = useState(false);

    const [isLiked, setIsLiked] = useState(false);
  
    // const openPopup = () => setShowPopup(true);
    // const closePopup = () => setShowPopup(false);

    const handleLikeClick = () => {
      setIsLiked(!isLiked);
    };

    const handleShareClick = () => {
      if (navigator.share) {
        navigator.share({
          title: 'Check out this event!',
          text: 'Here is an event you might be interested in:',
          url: window.location.href,
        })
        .then(() => console.log('Successful share'))
        .catch((error) => console.log('Error sharing', error));
      } else {
        // Fallback for browsers that do not support the Web Share API
        navigator.clipboard.writeText(window.location.href)
        .then(() => alert('Link copied to clipboard!'))
        .catch((error) => console.log('Error copying link', error));
      }
    };

    const [isModalOpen, setIsModalOpen] = useState(false);
    const [isRegistered, setIsRegistered] = useState(false);
  
    const handleRegistration = async () => {
        // console.log('Sending registratation data to the server:', registrationData)
      try {
        const response = await fetch('http://localhost:3000/register', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(registration),
        });
  
        const data = await response.json();
        console.log(data.message); // You've successfully registered for the event
  
        // Close the modal after registration
      //   setIsModalOpen(false);
      // } catch (error) {
      //   console.error('Error registering for the event', error);
      // }
      setIsRegistered(true); // Update state to indicate registration completion
    } catch (error) {
      console.error('Error registering for the event', error);
    }
    };

    const resetForm = () => {
      setRegistration({ eventName: '', name: '', className: '' });
      setIsRegistered(false);
    };

  return (       
    <div className="Post">

      <div className="shape">
        
      </div>

        <div className="pfp">
            <a href="/profile">
            <img src={sathaye} alt="not found" />
            <h4> <b>SATHAYE COLLEGE</b> </h4> </a>
        </div>

        <img src={data.image} alt="" />

        <div className="post-info">
               <button className="heart" onClick={handleLikeClick}>
                   {isLiked ? <FaHeart color="red" /> : <FaRegHeart />}
               </button>

               <button className="share" onClick={handleShareClick}>
               <TiArrowForwardOutline />
               </button>

                <button className="event-btn" 
                  onClick={() => { 
                    setIsModalOpen(true);
                    resetForm();
                  }}
                  disabled={isRegistered} // Disable button if already registered
                  > {isRegistered ? 'Registered' : 'Register'}
                </button>

        </div>
        
            <Modal
              isOpen={isModalOpen}
              onRequestClose={() => setIsModalOpen(false)}
              contentLabel="Registration Modal"
            >
              <div>
                {/* Cancel Icon */}
                <span className="cancel-icon" onClick={() => setIsModalOpen(false)}>
                  &#x2716;
                </span>

                { /* Registration Form */ }
                 <input
                  type="text"
                  placeholder="Name"
                  value={registration.name}
                  onChange={(e) => setRegistration({ ...registration, name: e.target.value })}
                />
                <input
                  type="text"
                  placeholder="Class"
                  value={registration.className}
                  onChange={(e) => setRegistration({ ...registration, className: e.target.value })}
                />
              <button onClick={handleRegistration} disabled={isRegistered}>
                  {isRegistered ? 'Registered' : 'Register' }
              </button>
              </div>
            </Modal>
 
        <div className="details">
            {/* <h2><b>{data.username}</b></h2> */}
             <p> {data.desc} </p> 
        </div>
 
    </div>

  );
};

export default Post;
